import { RestApiService } from './services/restapi.service';
import { Notify } from 'notiflix';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})

export class AppComponent implements OnInit {


  constructor() {

  }

  getData(): void {
    try
    {
      Notify.success('Accion realizada correctamente.');
    }
    catch{
      Notify.failure('Error en obtener informacion del servidor.');
    }
  }

  ngOnInit() {

  }

  title = 'Express Server Test Frontend';
}
<form (submit)="getData()" class="form-inline">
  <div class="form-group mb-2">
    <label for="staticEmail2" class="sr-only">Buscar ID de Ciudadano</label>
  </div>
  <div class="form-group mx-sm-3 mb-2">
    <label for="inputPassword2" class="sr-only">ID</label>
    <input class="form-control" id="inputPassword2" placeholder="ID">
  </div>
  <button type="submit" class="btn btn-primary mb-2">Solicitar</button>
</form>

